//estadisticas de promedio, asistencia y retardos 
//visualizacion en tabla con busqueda y ordenamiento
// src/pages/AdminDashboard.jsx
import Sidebar from "../components/Sidebar";
import Navbar from "../components/Navbar";

export default function AdminDashboard() {
  return (
    <div className="flex">
      <Sidebar />
      <div className="flex-1 flex flex-col">
        <Navbar />
        <main className="p-6 bg-gray-50 flex-1">
          <h2 className="text-2xl font-bold mb-4">Resumen general</h2>
          <div className="grid grid-cols-3 gap-4">
            <div className="bg-white shadow rounded p-4">
              <h3 className="font-semibold">Promedio llegadas</h3>
              <p className="text-3xl mt-2">8:10 AM</p>
            </div>
            <div className="bg-white shadow rounded p-4">
              <h3 className="font-semibold">Promedio salidas</h3>
              <p className="text-3xl mt-2">5:15 PM</p>
            </div>
            <div className="bg-white shadow rounded p-4">
              <h3 className="font-semibold">Usuarios más tardíos</h3>
              <ul className="mt-2 text-gray-600">
                <li>Juan Pérez (08:45)</li>
                <li>Laura Díaz (08:40)</li>
              </ul>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
}
